    StatMod_Strength, // Damage with melee weapons
    StatMod_Dexterity, // Damage with ranged weapons
    StatMod_Endurance, // Carry Weight, Stamina Regen
    StatMod_Vitality, // Health
    StatMod_Intellect, // Damage with spells
