    private Sprite[] ConvertResourceToSpriteArray(object[] resource)
    {
        List<Sprite> sprites = new List<Sprite>();
        foreach (object item in resource)
        {
            sprites.Add((Sprite)item);
        }
        return sprites.ToArray();
    }

